(2, '2', 'EMAIL', 'no-reply@test.com', 'Your One-Time Password (OTP) for Login', NULL, NULL, NULL, '<!DOCTYPE html>\r\n<html>\r\n  <head>\r\n    <meta charset=\"UTF-8\">\r\n    <title>Email Verification</title>\r\n    <link href=\"https://fonts.googleapis.com/css?family=NTR&display=swap\" rel=\"stylesheet\">\r\n    <style>\r\n      body {\r\n        background-color: #0F172A;\r\n        font-family: \'NTR\', sans-serif;\r\n        color: white;\r\n        margin: 0;\r\n        padding: 0;\r\n      }\r\n      .container {\r\n        max-width: 600px;\r\n        margin: auto;\r\n        background-color: #1E293F;\r\n        padding: 30px;\r\n        border-radius: 10px;\r\n        box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.25);\r\n      }\r\n      h1 {\r\n        text-align: center;\r\n        margin-top: 0;\r\n        margin-bottom: 20px;\r\n      }\r\n      p {\r\n        margin-top: 0;\r\n        margin-bottom: 20px;\r\n      }\r\n      .otp {\r\n        font-size: 24px;\r\n        text-align: center;\r\n        margin-top: 30px;\r\n        margin-bottom: 30px;\r\n        padding: 10px;\r\n        background-color: #2D3A5E;\r\n        border-radius: 5px;\r\n        box-shadow: 0px 0px 5px rgba(0, 0, 0, 0.25);\r\n      }\r\n      .footer {\r\n        text-align: center;\r\n        font-size: 14px;\r\n      }\r\n    </style>\r\n  </head>\r\n  <body>\r\n    <div class=\"container\">\r\n      <h1>Login Verification</h1>\r\n      <p>Hi $USER$,</p>\r\n      <p>Your one-time password (OTP) for logging into your $BRAND_NAME$ account is:</p>\r\n      <div class=\"otp\">$OTP$</div>\r\n    \r\n      <p >This OTP is valid for the next **10 minutes**. Please do not share this code with anyone for your account\'s security.\r\n</p>\r\n<p>If you did not request this OTP, please ignore this message or contact our support team immediately.\r\n</p>\r\n<br>\r\n<p>Thank You</p>\r\n  <p>The $BRAND_NAME$ Team</p>\r\n    </div>\r\n  </body>\r\n</html>', 1, NULL, NULL),
